import React, { useEffect, useRef, useContext } from 'react'
import { Container, Row, Button } from 'reactstrap'
import { NavLink, Link, useNavigate } from 'react-router-dom'
import Logo from '../../assets/images/logo.png'
import "./header.css"


const nav__links = [
   {
      path: '/home',
      display: 'Home'
   },
   {
      path: '/about',
      display: 'About'
   },
   {
      path: '/',
      display: 'Contact us'
   },
]

const Header = () => {
   const headerRef = useRef(null)
   const menuRef = useRef(null)
   const navigate = useNavigate()
   const { user, dispatch } = useContext(AuthContext)

   const logout = () => {
      dispatch({ type: 'LOGOUT' })
      navigate('/')
   }

   const stickyHeaderFunc = () => {
      window.addEventListener('scroll', () => {
         if (document.body.scrollTop > 80 || document.documentElement.scrollTop > 80) {
            headerRef.current.classList.add('sticky__header')
         } else {
            headerRef.current.classList.remove('sticky__header')
         }
      })
   }

   useEffect(() => {
      stickyHeaderFunc()

      return window.removeEventListener('scroll', stickyHeaderFunc)
   })

   const toggleMenu = () => menuRef.current.classList.toggle('show__menu')

   return (
     <header className="header" ref={headerRef}>
       <Container>
         <Row>
           <div className="nav__wrapper d-flex align-items-center justify-content-between">
             {/* ========== LOGO ========== */}
             <div className="logo-and-text d-flex align-items-center">
               <div className="logo">
                 <img
                   src="https://ci3.googleusercontent.com/mail-img-att/APrP3qHj5aoNs72FpZxj77IUl1TqlhTin42NbG1VZChk0fmkT9NrFpAcqDn6y-8e-5YPpC34F69OZ72VmuT3WLYUdJNlwFjY4TcY1kQ6FrUOEwCjuU-HERzW-vf-AgBoJ1ZT9YW-BdV17nvXDsjVwbb2LJtjLXO3RDgWWawt5Kaf6kxGY3blghqczI_8rGfHIO7j_-I6Ao8MRTu47-0ei2bhe81HDw5QK09qIT9YlRK1kr-pYhKI-gzWx09hBNR8Gw_iKloVWK4o2Yr4vzKFYCFrtTv-W3RGzxvJ6XM8RuOcO-ys0WKeXJACX9jlzuSYJ8NZqDHQkJiFABmDYRvH-0A08jbcIVD9koy9mEutS4VMU9soCw0ZDbHvV0wxeRTuyG9vm0G3zH21ndixrkJf0ZvSClsrXpAzdwR2U_uZUvle9HlIhFIZFT1LlSQO8wNoQc2PqzFDre5SB8zQ8glzTGr3z2f0Mddp2dQn_4Wu7o8TdHFYqkNJAF7UeK3KSVLIsIMffMfhG2o6XU1dKyzLCTNzTlQCvieZLGwt6RsQOuZZ9wCw2vyZD3BJy28mX5NkfUE8DqvmZwVE6HWqAQUCdFzfHEjw4zdIIJz9DWobTt9hL2LONK5PMPtOlXK3vyK080gNHaUsv7beErSonz3AuPimwN_XKNG-bYhrMQr1jNXVG7KgQw4eidJCnoYft5Zu81sxR_ZNg0lthUw0UjcF4VQGT_ThAIx-HwFIJgi1ccDZ8QitxkuEfzDUfFCxCCe7RafxCs6G5QKjyQHIg1q2001N8CfqljzHjAcyF1jKbT6cDaGvkR2mlSicG733wlJ6XVOdmil6THLC7E8-qpunti6-ErfD2YZLAKgmNzMehUe84D36kg5-BLyLA7JeRJYe2fLSIQ0Zi_5N9ibOg7O71_NwZNJTBCStYTJYd9URDGlb4kpwEmCK5pSDe96l0_A-cWYrH7gB627nHX-TxDphVpY6SyIembn1s-TDSqL8SV5yecfRjSgkuV28hzSZD8jxFSZ5MHlhfYA05wN2RLBYgVXvSf_3bBRy-537-R1-WH9Z4-H-eowRGkO1Q2cUC8z-1Q2xKrVn9-GlG_nxJUoX36Q73l4st8Y=s0-l75-ft"
                   alt=""
                 />
               </div>
               <div className="text-portion ml-0.5">
                 <p style={{ color: "#e85d04", fontSize: "18px" }}>KhelNepal</p>
               </div>
             </div>
             {/* ========================== */}

             {/* ========== MENU START ========== */}
             <div className="navigation" ref={menuRef} onClick={toggleMenu}>
               <ul className="menu d-flex align-items-center gap-5">
                 {nav__links.map((item, index) => (
                   <li className="nav__item" key={index}>
                     <NavLink
                       to={item.path}
                       className={(navClass) =>
                         navClass.isActive ? "active__link" : ""
                       }
                     >
                       {item.display}
                     </NavLink>
                   </li>
                 ))}
               </ul>
             </div>
             {/* ================================ */}

             <div className="nav__right d-flex align-items-center gap-4">
               <div className="nav__btns d-flex align-items-center gap-2">
                 {user ? (
                   <>
                     {" "}
                     <h5 className="mb-0">{user.username}</h5>
                     <Button className="btn btn-dark" onClick={logout}>
                       Logout
                     </Button>
                   </>
                 ) : (
                   <>
                     <Button className="btn secondary__btn">
                       <Link to="/login">Login</Link>
                     </Button>
                     <Button className="btn primary__btn">
                       <Link to="/register">Register</Link>
                     </Button>
                   </>
                 )}
                 {/* <Button className='btn secondary__btn'><Link to='/login'>Login</Link></Button>
                        <Button className='btn primary__btn'><Link to='/register'>Register</Link></Button> */}
               </div>

               <span className="mobile__menu" onClick={toggleMenu}>
                 <i class="ri-menu-line"></i>
               </span>
             </div>
           </div>
         </Row>
       </Container>
     </header>
   );
}

export default Header
